# Radial transforms
# Transform 1-1: NormalizedTransform
const TRANS_1_1_YIN = 1.0
const TRANS_1_1_YCUT = 0.31595991688262165
const TRANS_1_1_P = 2
const TRANS_1_1_Q = 4
const TRANS_1_1_R0 = 2.9
const TRANS_1_1_RIN = 0.0
const TRANS_1_1_A = 0.7692307692307693

@inline function transform_1_1(r::T) where {T}
    rin = TRANS_1_1_RIN
    if r <= rin
        return one(T)
    end
    r0, q, p, a = TRANS_1_1_R0, TRANS_1_1_Q, TRANS_1_1_P, TRANS_1_1_A
    s = (r - rin) / (r0 - rin)
    y = (a + s^q) / (a + s^p)
    # Normalize
    yin, ycut = TRANS_1_1_YIN, TRANS_1_1_YCUT
    return clamp(-one(T) + 2 * (y - yin) / (ycut - yin), -one(T), one(T))
end

# Transform with derivative dx/dr
@inline function transform_d_1_1(r::T) where {T}
    rin = TRANS_1_1_RIN
    if r <= rin
        return one(T), zero(T)
    end
    r0, q, p, a = TRANS_1_1_R0, TRANS_1_1_Q, TRANS_1_1_P, TRANS_1_1_A
    yin, ycut = TRANS_1_1_YIN, TRANS_1_1_YCUT

    s = (r - rin) / (r0 - rin)
    ds_dr = one(T) / (r0 - rin)

    # y = (a + s^q) / (a + s^p)
    num = a + s^q
    den = a + s^p
    y = num / den

    # dy/ds = (q*s^(q-1)*den - p*s^(p-1)*num) / den^2
    dnum_ds = q > 0 ? q * s^(q-1) : zero(T)
    dden_ds = p > 0 ? p * s^(p-1) : zero(T)
    dy_ds = (dnum_ds * den - dden_ds * num) / (den * den)
    dy_dr = dy_ds * ds_dr

    # x = -1 + 2*(y - yin)/(ycut - yin)
    scale = 2 / (ycut - yin)
    x = -one(T) + scale * (y - yin)
    dx_dr = scale * dy_dr

    # Clamp: if outside [-1, 1], derivative is zero
    if x <= -one(T) || x >= one(T)
        return clamp(x, -one(T), one(T)), zero(T)
    end
    return x, dx_dr
end

