# Radial envelopes
# Envelope 1-1: PolyEnvelope2sX
const ENV_1_1_X1 = -1.0
const ENV_1_1_X2 = 1.0
const ENV_1_1_P1 = 2
const ENV_1_1_P2 = 2
const ENV_1_1_S = 1.0

@inline function envelope_1_1(r::T, x::T) where {T}
    x1, x2 = ENV_1_1_X1, ENV_1_1_X2
    if !(x1 < x < x2)
        return zero(T)
    end
    p1, p2, s = ENV_1_1_P1, ENV_1_1_P2, ENV_1_1_S
    return s * (x - x1)^p1 * (x2 - x)^p2
end

# Envelope with derivative denv/dx
@inline function envelope_d_1_1(r::T, x::T) where {T}
    x1, x2 = ENV_1_1_X1, ENV_1_1_X2
    if !(x1 < x < x2)
        return zero(T), zero(T)
    end
    p1, p2, s = ENV_1_1_P1, ENV_1_1_P2, ENV_1_1_S

    # env = s * (x - x1)^p1 * (x2 - x)^p2
    left = (x - x1)^p1
    right = (x2 - x)^p2
    env = s * left * right

    # denv/dx = s * (p1*(x-x1)^(p1-1)*(x2-x)^p2 - p2*(x-x1)^p1*(x2-x)^(p2-1))
    dleft_dx = p1 > 0 ? p1 * (x - x1)^(p1-1) : zero(T)
    dright_dx = p2 > 0 ? -p2 * (x2 - x)^(p2-1) : zero(T)
    denv_dx = s * (dleft_dx * right + left * dright_dx)

    return env, denv_dx
end

