# Linear interpolation of spline coefficients
@inline function spline_1_2(x::T) where {T}
    # Find interval
    idx_f = (x - SPL_1_2_XSTART) / SPL_1_2_XSTEP + 1
    idx = floor(Int, idx_f)
    idx = clamp(idx, 1, SPL_1_2_XLEN - 1)
    t = T(idx_f - idx)

    # Linear interpolation between spline coefficients (type-stable via Tuple indexing)
    @inbounds c0 = SPL_1_2_COEFFS[idx]
    @inbounds c1 = SPL_1_2_COEFFS[idx+1]
    return (one(T) - t) .* c0 .+ t .* c1
end

# Spline with derivative dspl/dx
@inline function spline_d_1_2(x::T) where {T}
    # Find interval
    idx_f = (x - SPL_1_2_XSTART) / SPL_1_2_XSTEP + 1
    idx = floor(Int, idx_f)
    idx = clamp(idx, 1, SPL_1_2_XLEN - 1)
    t = T(idx_f - idx)

    @inbounds c0 = SPL_1_2_COEFFS[idx]
    @inbounds c1 = SPL_1_2_COEFFS[idx+1]

    # spl = (1-t)*c0 + t*c1
    spl = (one(T) - t) .* c0 .+ t .* c1

    # dspl/dx = dspl/dt * dt/dx = (c1 - c0) / step
    dspl_dx = (c1 .- c0) ./ T(SPL_1_2_XSTEP)

    return spl, dspl_dx
end

