# Linear interpolation of spline coefficients
@inline function spline_2_2(x::T) where {T}
    # Find interval
    idx_f = (x - SPL_2_2_XSTART) / SPL_2_2_XSTEP + 1
    idx = floor(Int, idx_f)
    idx = clamp(idx, 1, SPL_2_2_XLEN - 1)
    t = T(idx_f - idx)

    # Linear interpolation between spline coefficients (type-stable via Tuple indexing)
    @inbounds c0 = SPL_2_2_COEFFS[idx]
    @inbounds c1 = SPL_2_2_COEFFS[idx+1]
    return (one(T) - t) .* c0 .+ t .* c1
end

# Spline with derivative dspl/dx
@inline function spline_d_2_2(x::T) where {T}
    # Find interval
    idx_f = (x - SPL_2_2_XSTART) / SPL_2_2_XSTEP + 1
    idx = floor(Int, idx_f)
    idx = clamp(idx, 1, SPL_2_2_XLEN - 1)
    t = T(idx_f - idx)

    @inbounds c0 = SPL_2_2_COEFFS[idx]
    @inbounds c1 = SPL_2_2_COEFFS[idx+1]

    # spl = (1-t)*c0 + t*c1
    spl = (one(T) - t) .* c0 .+ t .* c1

    # dspl/dx = dspl/dt * dt/dx = (c1 - c0) / step
    dspl_dx = (c1 .- c0) ./ T(SPL_2_2_XSTEP)

    return spl, dspl_dx
end


# Radial basis evaluation (returns SVector{N_RNL, T})
@inline function evaluate_Rnl(r::T, iz::Int, jz::Int)::SVector{N_RNL, T} where {T}
    # Get transform and envelope for this species pair
    # (Dispatched at compile time for small NZ)
    
    if iz == 1 && jz == 1
        rcut = RIN0CUT_1_1.rcut
        if r >= rcut; return zero(SVector{N_RNL, T}); end
        x = transform_1_1(r)
        env = envelope_1_1(r, x)
        return env .* spline_1_1(x)
    elseif iz == 1 && jz == 2
        rcut = RIN0CUT_1_2.rcut
        if r >= rcut; return zero(SVector{N_RNL, T}); end
        x = transform_1_2(r)
        env = envelope_1_2(r, x)
        return env .* spline_1_2(x)
    elseif iz == 2 && jz == 1
        rcut = RIN0CUT_2_1.rcut
        if r >= rcut; return zero(SVector{N_RNL, T}); end
        x = transform_2_1(r)
        env = envelope_2_1(r, x)
        return env .* spline_2_1(x)
    elseif iz == 2 && jz == 2
        rcut = RIN0CUT_2_2.rcut
        if r >= rcut; return zero(SVector{N_RNL, T}); end
        x = transform_2_2(r)
        env = envelope_2_2(r, x)
        return env .* spline_2_2(x)
    end
    # Fallback for unknown species pair
    return zero(SVector{N_RNL, T})
end

# Radial basis evaluation with derivative dRnl/dr
@inline function evaluate_Rnl_d(r::T, iz::Int, jz::Int)::Tuple{SVector{N_RNL, T}, SVector{N_RNL, T}} where {T}
    
    if iz == 1 && jz == 1
        rcut = RIN0CUT_1_1.rcut
        if r >= rcut; return zero(SVector{N_RNL, T}), zero(SVector{N_RNL, T}); end
        # Transform with derivative
        x, dx_dr = transform_d_1_1(r)
        # Envelope with derivative
        env, denv_dx = envelope_d_1_1(r, x)
        # Spline with derivative
        spl, dspl_dx = spline_d_1_1(x)
        # Rnl = env * spl
        Rnl = env .* spl
        # dRnl/dr = denv/dr * spl + env * dspl/dr
        #         = denv/dx * dx/dr * spl + env * dspl/dx * dx/dr
        dRnl_dr = (denv_dx * dx_dr) .* spl .+ env .* dspl_dx .* dx_dr
        return Rnl, dRnl_dr
    elseif iz == 1 && jz == 2
        rcut = RIN0CUT_1_2.rcut
        if r >= rcut; return zero(SVector{N_RNL, T}), zero(SVector{N_RNL, T}); end
        # Transform with derivative
        x, dx_dr = transform_d_1_2(r)
        # Envelope with derivative
        env, denv_dx = envelope_d_1_2(r, x)
        # Spline with derivative
        spl, dspl_dx = spline_d_1_2(x)
        # Rnl = env * spl
        Rnl = env .* spl
        # dRnl/dr = denv/dr * spl + env * dspl/dr
        #         = denv/dx * dx/dr * spl + env * dspl/dx * dx/dr
        dRnl_dr = (denv_dx * dx_dr) .* spl .+ env .* dspl_dx .* dx_dr
        return Rnl, dRnl_dr
    elseif iz == 2 && jz == 1
        rcut = RIN0CUT_2_1.rcut
        if r >= rcut; return zero(SVector{N_RNL, T}), zero(SVector{N_RNL, T}); end
        # Transform with derivative
        x, dx_dr = transform_d_2_1(r)
        # Envelope with derivative
        env, denv_dx = envelope_d_2_1(r, x)
        # Spline with derivative
        spl, dspl_dx = spline_d_2_1(x)
        # Rnl = env * spl
        Rnl = env .* spl
        # dRnl/dr = denv/dr * spl + env * dspl/dr
        #         = denv/dx * dx/dr * spl + env * dspl/dx * dx/dr
        dRnl_dr = (denv_dx * dx_dr) .* spl .+ env .* dspl_dx .* dx_dr
        return Rnl, dRnl_dr
    elseif iz == 2 && jz == 2
        rcut = RIN0CUT_2_2.rcut
        if r >= rcut; return zero(SVector{N_RNL, T}), zero(SVector{N_RNL, T}); end
        # Transform with derivative
        x, dx_dr = transform_d_2_2(r)
        # Envelope with derivative
        env, denv_dx = envelope_d_2_2(r, x)
        # Spline with derivative
        spl, dspl_dx = spline_d_2_2(x)
        # Rnl = env * spl
        Rnl = env .* spl
        # dRnl/dr = denv/dr * spl + env * dspl/dr
        #         = denv/dx * dx/dr * spl + env * dspl/dx * dx/dr
        dRnl_dr = (denv_dx * dx_dr) .* spl .+ env .* dspl_dx .* dx_dr
        return Rnl, dRnl_dr
    end
    # Fallback for unknown species pair
    return zero(SVector{N_RNL, T}), zero(SVector{N_RNL, T})
end

